import React from 'react'
import Activity from './Activity';
import activityData from '../activityData'

const ActivitySection = () => {
  return (
    <div>
      <h2>
        Activity Section
      </h2>
      {activityData.map(activity => {
        <Activity activity={activity} />
      })}
    </div>
  )
}

export default ActivitySection
